import React from 'react';
import './Receipt.css'
import img from './samples/receipt.png'
import axios from 'axios'
import {useParams} from 'react-router-dom'


const Receipt=() => {

  let {number}  = useParams();
    if(number==undefined)
        number=""

  let p;
  let url = '/api/'+ number
  axios.get(url).then(function(res){
     console.log(res.data);
     if(res.data!=null){
      
       p=res.data;
     }
     else
     {
         return(<>
           NO CAR EXISTS
         </>)
      
     }

     
 })

  return(
  <>
  <div className="body">
    <div className="receipt-title">
      Parking Receipt
    </div>
    <div className="receipt-pic">

        <img src={img} alt="CAR"></img>
    </div>
    <div className="receipt-car">
        <div className="receipt-car-title">
            <div><h4> Parking Details</h4></div>

            <div>{p.id}</div>
        </div>
    
        <div className="receipt-car-name">
            <div> {p.color}, {p.model}<br/> {p.plateNumber}</div>

            <div>Slot No. :- {p.slot}</div>
        </div>

    </div>
    <div className="receipt-right">
        
        <div> Parking History ></div>

      </div>
  </div>
  </>)

}

export default Receipt;
